import React, { Component } from 'react'

class DisplayInfo extends Component {
    constructor(props) {
      super(props)


    }
  render() {
      const{firstName,lastName,title,address,phonenr,email,description,work,workExp} = this.props;
    return (
      <div>
          <h2>{firstName}</h2>
          <h2>{lastName}</h2>
          <h2>{title}</h2>
          <h2>{address}</h2>
          <h2>{phonenr}</h2>
          <h2>{email}</h2>
          <h2>{description}</h2>
          <h2>
              proba
              {workExp.map((work)=>{
                  return <input type="text "placeholder="Position" key={work.id}>{work.position}</input>
              })}
          </h2>
      </div>
    )
  }
}

export default DisplayInfo
